import React, { useState } from 'react';
import Select from '../../Select';

function FilterHistoric(props) {
    console.log("essa sao as props", props)
    const [status, setStatus] = useState("");

    const changeStatus = s => {
        setStatus(s.props.historico.find((item) => {
            return item.status
        }))
        props.setHistorico("status", s)
    }

    return (
        <div className="containerFilter">
            <div className="containerSelects">
                <div className="containerSelect">
                    <Select
                        onChange={changeStatus}
                        width={'150px'}
                        placeholder={status ? status : "selecionar"}
                        options={props.historico.map((item) => {return item})}
                        classNames={'select-class'}
                        name="statusDuel"
                    />
                </div>
            </div>
        </div>
    )
}

export default FilterHistoric;
